import { Text, View } from "react-native";

export default function Profile() {
	return (
		<View
			style={{
				backgroundColor: "black",
				flex: 1,
				alignItems: "center",
				justifyContent: "center",
			}}
		>
			<Text style={{ color: "white" }}>Profile</Text>
		</View>
	);
}
